member.param:
The fully qualified deny assignment ID. For example, use the
format,
/subscriptions/{guid}/providers/Microsoft.Authorization/denyAssignments/{denyAssignmentId}
for subscription level deny assignments, or
/providers/Microsoft.Authorization/denyAssignments/{denyAssignmentId}
for tenant level deny assignments.

The fully qualified role definition ID. Use the format,
/subscriptions/{guid}/providers/Microsoft.Authorization/roleDefinitions/{roleDefinitionId}
for subscription level role definitions, or
/providers/Microsoft.Authorization/roleDefinitions/{roleDefinitionId}
for tenant level role definitions.
